import React from "react";
import { MDBCard,MDBCardHeader, MDBCardBody, MDBCardTitle, MBSBtn, MDBRow, MDBCol, MDBIcon, MDBContainer} from 'mdbreact';


const useStyles = makeStyles((theme) => ({
    root: {
      maxWidth: 800,
    },
    media: {
      height: 0,
      paddingTop: '56.25%', // 16:9
    },
    expand: {
      transform: 'rotate(0deg)',
      marginLeft: 'auto',
      transition: theme.transitions.create('transform', {
        duration: theme.transitions.duration.shortest,
      }),
    },
    expandOpen: {
      transform: 'rotate(180deg)',
    },
    avatar: {
      backgroundColor: red[500],
    },
  }));

function Post() {
    const classes = useStyles();
  const [expanded, setExpanded] = React.useState(false);

  const handleExpandClick = () => {
    setExpanded(!expanded);
  };
    return(
        <MDBCol className="post pr-3 pb-4" lg="7">
            <MDBContainer fluid className="post_container">
                <MDBRow>
                    <MDBCol md="6">
                        <MDBBtn className="post_button" href="#" color="default" size="lg">
                            Add Post
                        </MDBBtn>
                    </MDBCol>
                    <MDBCol md="6">
                        <MDBBtn className="post_button" href="#" color="default" size="lg">
                            Add Interview Experience
                        </MDBBtn>
                    </MDBCol>
                </MDBRow>
                <MDBRow className="mt-5">
                    <MDBCard>

                    </MDBCard>
                </MDBRow>
            </MDBContainer>
        </MDBCol>
    )
}

export default Post
